import React from "react";
import { useNavigate } from "react-router-dom";

import "../styles/Admin.css";
import Navbar from "./components";

const Admin = () => {
  const navigate = useNavigate();

  const ModuleCard = ({ header, imageSrc, altText, navigateTo }) => (
    <div className="card-container">
      <h1 className="card-header">{header}</h1>
      <div className="card-body">
        <div>
          <img src={imageSrc} alt={altText} />
        </div>
        <button onClick={() => navigate(navigateTo)} type="button">
          Open
        </button>
      </div>
    </div>
  );
  return (
    <>
      <>
        <Navbar page={"admin"} />
      </>
      <div className="cards">
        <ModuleCard
          header="Students Module"
          imageSrc="/education.png"
          altText="Students Icon"
          navigateTo="/students-module"
        />
        <ModuleCard
          header="Test Module"
          imageSrc="/test.png" // example image for the Test module
          altText="Test Icon"
          navigateTo="/test-module"
        />
      </div>
    </>
  );
};

export default Admin;
